  false,\n\t\"url\": null,\n\t\"notes\": \"Objectives of the 2013 Small Pelagics Acoustic/Trawl
  Survey were to sample the northern Gulf of Mexico with a 90-ft high opening trawl
  to facilitate assessments of abundance and distribution of small pelagic fish species,
  estimate size structures of sampled populations, collect ichtyoplankton samples
  to mad distribution of fish eggs and larvae, collect profiles of conductivity, temperature,
  dissolved oxygen, fluorescence, and transmisivity at each sample site, collect splitbeam
  echosounder data, and collect multibeam echosounder data at select survey areas.\",\n\t\"owner_org\":
